import React from "react";
import styled from "styled-components";

const IphoneMain = () => {
    return (
        <IphoneMainContainer>
            <IphoneMainTitle className="SF_h2">Наши проекты</IphoneMainTitle>
            <AppContainer>

                <OpenBtn>
                    <span className="buttonText">Открыть</span>
                </OpenBtn>
            </AppContainer>
            <AppContainer>

                <OpenBtn>Открыть</OpenBtn>
            </AppContainer>
            <AppContainer>

                <OpenBtn>Открыть</OpenBtn>
            </AppContainer>
        </IphoneMainContainer>
    )
}

const IphoneMainContainer = styled.div`
    width: 100%;
    height: 90%;
    background-color: white;
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    align-items: center;

`

const IphoneMainTitle = styled.div`
    width: 100%;
    padding: 11px 0px;
    text-align: center;
    box-shadow: 0px 0.5px 0px rgba(0, 0, 0, 0.3);
`

const AppContainer = styled.div`
    width: 90%;
    padding: 8px 0px 0px;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
    border-bottom: 1px solid var(--LightGrey);
`

const AppName = styled.div`
    width: 60%;
`

const OpenBtn = styled.button`
    width: 97px;
    height: 24px;
    color: var(--Blue);
    background-color: var(--LightGrey);
    border-radius: 24px;
    border: unset;
`

export default IphoneMain
